const baseUrl = `../assets/images/`;

export const prayerbeads = [
  {
    id: 1,
    count: 5,
    location: `Ashina Outskirts`,
    location_img: `${baseUrl}Ashina-Outskirts.webp`,
    locations: [
      {
        title: `General Naomori Kawarada`,
        location: `Outskirts Wall - Gate Path`,
        description: `Defeat General Naomori Kawarada at the Outskirts Wall - Gate Path`,
        isRewarded: true,
        procurement: `Rewarded`
      },
      {
        title: `Chained Ogre`,
        location: `Outskirts Wall - Stairway`,
        description: `Defeat the Chained Ogre`,
        isRewarded: true,
        procurement: `Rewarded`
      },
      {
        title: `Tenzen Yamauchi`,
        location: `Outskirts Wall - Stairway`,
        description: `Defeat Tenzen Yamauchi in the courtyard just beyond the Outskirts Wall - Stairway and near the Underbridge Valley`,
        isRewarded: true,
        procurement: `Rewarded`
      },
      {
        title: `Temple Attic`,
        location: `Ashina Castle Gate`,
        description: `In a chest in the attic of the temple where you speak with the Tengu of Ashina for the 1st time. You must grapple up the rafters and then wall jump into the attic. You must first defeat Gyoubu Oniwa before you can access this area.`,
        isRewarded: false,
        procurement: `Discovered`
      },
      {
        title: `Blazing Bull`,
        location: `Ashina Castle Gate`,
        description: `Defeat the Blazing Bull beyond the Ashina Castle Gate and just outside Ashina Castle`,
        isRewarded: true,
        procurement: `Rewarded`
      }
    ]
  },
  {
    id: 2,
    count: 1,
    location: `Ashina Outskirts - during Ministry invasion`,
    location_img: ``,
    locations: [
      {
        title: `Shigekichi of the Red Guard`,
        location: `Outskirts Wall - Stairway`,
        description: `Defeat Shigekichi of the Red Guard in the courtyard just beyond the Outskirts Wall - Stairway`,
        isRewarded: true,
        procurement: `Rewarded`
      }
    ]
  },
  {
    id: 3,
    count: 3,
    location: `Hirata Estate`,
    location_img: ``,
    locations: [
      {
        title: `Shinobi Hunter Enshin of Misen`,
        location: `Bamboo Thicket Slope`,
        description: `Defeat Shinobi Hunter Enshin of Misen beyond the Estate Path bridge and just before the Bamboo Thicket Slope`,
        isRewarded: true,
        procurement: `Rewarded`
      },
      {
        title: `Juzou the Drunkard`,
        location: `Hirata Estate - Main Hall`,
        description: `Defeat Juzou the Drunkard at the Hirata Estate - Main Hall courtyard`,
        isRewarded: true,
        procurement: `Rewarded`
      },
      {
        title: `Beyond hidden wall panel`,
        location: `Hirata Audience Chamber`,
        description: `In a chest behind the hidden wall near the Hirata Audience Chamber Sculptor's Idol. The hidden wall is denoted by a wall scroll at the end of the pathway being patrolled by the Bandit Soldier & Bandit Archer.`,
        isRewarded: false,
        procurement: `Discovered`
      },
    ]
  },
  {
    id: 4,
    count: 2,
    location: `Hirata Estate - second memory`,
    location_img: ``,
    locations: [
      {
        title: `Shigekichi of the Red Guard`,
